import { useRouter } from "next/dist/client/router";
import AppLayout from "../../components/AppLayout";

const User = () => {
  const router = useRouter();
  const { id } = router.query;
  return (
    <AppLayout>
      <Head>{id}의 글 모음집</Head>
    </AppLayout>
  );
};

export default User;
